import React from 'react';
import './App.css';
import Header from './Components/Header';
import Footer from './Components/Footer';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <h1>Chào mừng đến với website của tôi!</h1>
        <p>Đây là nội dung chính của trang.</p>
      </main>
      <Footer />
    </div>
  );
}

export default App;
